import '../styles/App.css';
import Navbar from './Navbar';
import ContactList from './ContactList';

function App() {
  return (
    <div className="App">
      <div className="container">
        <Navbar />
        <ContactList/>
        <img src="../" alt="" />
      </div>
    </div>
  );
}

export default App;
